import React from 'react'

const Card = (p) => {
    return (
        <div>
            {/* {
                console.log(p)
            } */}
            {
                p.details.map(()=>(
                    <div className="card" style={{ width: "18rem" }}>
                <div className="card-body">
                    <h5 className="card-title">{p.details[0].title}</h5>
                    <p className="card-text">
                    {p.details[0].content}
                    </p>
                    {/* <a href="#" className="btn btn-primary">
                        Go somewhere
                    </a> */}
                </div>
            </div>
                ))
            }
            
        </div>
    )
}

export default Card

